import React, { Component } from "react";
 
class Contact extends Component {
  render() {
    return (
      <div>
        <h2>GOT QUESTIONS?</h2>
        <p>The easiest thing to do is to visit in
        our Hospital Or Contact us on our Phone No. #123456789
        </p>
      </div>
    );
  }
}
 
export default Contact;
